import React, { Component } from 'react';

class App extends Component {
  state = {
    neo:[]
  }





  componentDidMount(){
    fetch('https://api.nasa.gov/neo/rest/v1/feed?start_date=2015-09-07&end_date=2015-09-08&api_key=UrXJyJZWfOwzULw07rfPFuiur4cEsYCmC7WaSkTZ')
    .then(res => res.json())
    .then
  }

  render () {
    return (
    <div class ="card">
      <div class="card-body">
        <h5 class ="card-title"> Near Earth Objects </h5>
          <h6 class ="card-subtitle mb-2 text-muted"> Name of asteroid</h6>
          <p class ="card-text">Some other information about the asteroid</p>
      </div>
    </div>

    );
  }
}

export default App;
